import React from 'react';
import styled from 'styled-components';
import {Box, Button, Grid} from '@material-ui/core'
import s from '../../styles/styles.module.css'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Spacer from 'react-spacer'


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,

    },
    paper: {
        height: 250,
        width: 250,
      padding: theme.spacing(2),
      textAlign: 'center'

    },
    control: {
      padding: theme.spacing(2),
    },
  }));


  export default function Hero() {
    const [spacing, setSpacing] = React.useState(2);
    const classes = useStyles();
    const Text = styled.p`
    color: white;
    text-align: left;
    font-size: 1em;
    margin: 1em;
    padding: 0.25em 1em;
    `
    const BoxHeading = styled.h3`
    text-transform: uppercase;
    text-align: left;
    margin-bottom: 5px;
    `
    const Notes = styled.p`
    text-align: left;
    margin: 0px 0px 5px 0px;
    `
   return (
    <Box p={2} bgcolor="primary.dark" color="primary.contrastText" >
         <Grid container justify="center" spacing={spacing}>
            <Grid item md={8} sm={10} xs={12}>
        <Grid container justify="center" spacing={spacing}>
            <Grid item xs={12}>
                <Spacer height="40px"/>
                <h2 className={s.header} style={{textAlign: 'center'}}>
                Use our platform to get instant results
                </h2>
                <p className={s.subheader}>Start and stop models easily, schedule run times, and set up dashboards, counting algorithms, and notification systems through our user-friendly UI </p>
                <Spacer height="40px"/>
                <h3 className={s.subclass}>Featured models</h3>
            </Grid> 
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            <Grid item>
              <Paper className={`${classes.paper}`} />
              <BoxHeading>Australian Currency</BoxHeading>
              <Notes>13 Classes · 99% mAP · 30FPS</Notes>
            </Grid>
            </Grid> 
        </Grid> 
        </Grid>
    </Box>

)
}
